import React, { Component } from 'react'

export default class searches extends Component {

    redirect = () => {
        console.log("wow")
        this.props.history.push("../")
    }

    render() {
        return (
            <div>
                <button onClick={()=>this.redirect()}>Back to Main Page</button>
            </div>
        )
    }
}
